import React, { useState, useEffect } from 'react';
import axios from 'axios';

function UpdateRecipe({ field, initialValue, onUpdate, id, authToken }) {
  const [isEditing, setIsEditing] = useState(false);
  const [value, setValue] = useState(initialValue);
  const [isUpdating, setIsUpdating] = useState(false);
  const [isAuthorized, setIsAuthorized] = useState(false);

  useEffect(() => {
    setValue(initialValue);
  }, [initialValue]);

  useEffect(() => {
    const checkAuthorization = async () => {
      try {
        const response = await axios.get('http://localhost:5000/check-authorization', {
          headers: {
            Authorization: `Bearer ${authToken}`,
          },
        });

        setIsAuthorized(response.data.isAuthorized);
      } catch (error) {
        setIsAuthorized(false);
      }
    };

    checkAuthorization();
  }, [authToken]);

  const handleEdit = () => {
    if (!isAuthorized) {
      alert("You cannot edit this recipe because you are not the original creator.");
      return;
    }

    setIsEditing(true);
  };

  const handleCancel = () => {
    setIsEditing(false);
    setValue(initialValue);
  };

  const handleChange = (e) => {
    setValue(e.target.value);
  };

  const handleFileChange = (e) => {
    const file = e.target.files[0];
    console.log('Selected File:', file);
    setValue(file);
  };

  const handleSubmit = async (e) => {
    e.preventDefault();

    if (isUpdating) {
      console.log('Update already in progress. Ignoring.');
      return;
    }

    setIsUpdating(true);

    setIsEditing(false);

    try {
      const formData = new FormData();

      if (field === 'image') {
        formData.append('field', 'image');
        formData.append('image', value);
      } else {
        formData.append('field', field);
        formData.append('value', value);
      }

      const response = await axios.put(`http://localhost:5000/recipes/${id}`, formData, {
        headers: {
          Authorization: `Bearer ${authToken}`,
          'Content-Type': 'multipart/form-data',
        },
      });

      if (onUpdate) {
        onUpdate(field, response.data[field]);
      }
    } catch (error) {
      console.error(`Error updating ${field}:`, error);
    } finally {
      setIsUpdating(false);
    }
  };

  return (
    <div>
      {isEditing ? (
        <form onSubmit={handleSubmit}>
          {field === 'image' ? (
            <>
              <label>Choose new image</label>
              <input type="file" onChange={handleFileChange} accept="image/*" />
            </>
          ) : (
            <>
              <label>{field}</label>
              <textarea name={field} value={value} onChange={handleChange} required />
            </>
          )}
          <button type="submit">Update</button>
          <button type="button" onClick={handleCancel}>
            Cancel
          </button>
        </form>
      ) : (
        <button type="button" onClick={handleEdit}>
          Edit {field}
        </button>
      )}
    </div>
  );
}

export default UpdateRecipe;
